import React from 'react'
import './Pressure.css'
import ArrowDownwardIcon from '@mui/icons-material/ArrowDownward';


const Pressure = (props) => {
    const {weather, dummyData} = props

    const pres = (press) => {
        let formula = press / 33.864
        return parseFloat(formula.toString().split().splice(0, 5))
    }

    return (
        <div className='pressure'>
            <p><ArrowDownwardIcon /> Pressure</p>
            { weather ? <p className='pres-num'>{pres(weather.main.pressure)}</p> :  <p className='pres-num'>{pres(dummyData.main.pressure)}</p>}
        </div>
    )
}

export default Pressure
